CREATE PROCEDURE `prc_launch_missile`(IN `matchId` INT, OUT `outParam` VARCHAR(255))
BEGIN


	DECLARE hogaya INT DEFAULT FALSE;

	DECLARE v_player_id INT;
	DECLARE v_runs INT DEFAULT 0;
	DECLARE v_wickets INT DEFAULT 0;
	DECLARE v_catches INT DEFAULT 0;
	DECLARE v_run_outs INT DEFAULT 0;

	DECLARE v_user_fixtures_tbl_id INT;
	DECLARE v_user_one_id INT;
	DECLARE v_user_two_id INT;

	DECLARE v_user_selection_tbl_id INT;
	DECLARE v_user_team_selection_id INT;
	DECLARE v_user_mom_selection_id INT;

	DECLARE v_team_winner_id INT;
	DECLARE v_match_player_mom_id INT;

	DECLARE v_total_points INT;
    
    DECLARE v_count INT DEFAULT 0;
    
    DECLARE v_team_player_count INT DEFAULT 0;
    DECLARE v_user_win_team_player_points INT;
    
    DECLARE v_user_one_total_points INT DEFAULT 0;
	DECLARE v_user_two_total_points INT DEFAULT 0;
    
	 
	DECLARE user_fixtures_cur CURSOR FOR SELECT user_fixtures_tbl_id, user_one_id, user_two_id 
										   FROM ipl.user_fixtures_tbl 
										  WHERE match_id = matchId;
										  
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET hogaya = TRUE;

	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN RESIGNAL;
    ROLLBACK;
    SELECT 'An error has occurred, operation rollbacked and the stored procedure was terminated';
RESIGNAL;
    set outParam = 'error';
    END;

	START TRANSACTION;
    
	SELECT count(1) INTO v_count FROM match_fixtures_tbl WHERE match_fixtures_tbl_id = matchId;
    
    IF v_count > 0 THEN
    
		### UPDATING INDIVIDUAL PLAYERS TOTAL FOR MATCH
		UPDATE player_individual_score_tbl 
		SET 
		total_points = 
			(runs * (SELECT points FROM ipl.points_detail_tbl where points_category_code = 'run')) +
			(wickets * (SELECT points FROM ipl.points_detail_tbl where points_category_code = 'wkt')) +
			(catches * (SELECT points FROM ipl.points_detail_tbl where points_category_code = 'catch')) +
			(run_outs * (SELECT points FROM ipl.points_detail_tbl where points_category_code = 'runout')) +
            (stumps * (SELECT points FROM ipl.points_detail_tbl where points_category_code = 'stumps'))
		WHERE
			match_fixture_id = matchId;


		### GETTING TEAM WINNER AND MAN OF THE MATCH
		SELECT mf.team_winner_id #, pt.player_id 
		  INTO v_team_winner_id #, v_match_player_mom_id
		 FROM ipl.match_fixtures_tbl mf #, ipl.player_individual_score_tbl pt 
		WHERE #mf.match_fixtures_tbl_id = pt.match_fixture_id
		  #AND 
          mf.match_fixtures_tbl_id = matchId;
		  #AND pt.is_mom = 1;
		 
		 
		###
		OPEN user_fixtures_cur;
		start_loop : LOOP
			FETCH user_fixtures_cur INTO v_user_fixtures_tbl_id, v_user_one_id, v_user_two_id;
			
				IF hogaya THEN
					LEAVE start_loop;
				END IF;
				
			### For FIRST USER
				SELECT user_selection_tbl_id, user_team_selection_id, user_mom_selection_id 
				  INTO v_user_selection_tbl_id, v_user_team_selection_id, v_user_mom_selection_id
				  FROM ipl.user_selection_tbl 
				 WHERE user_id = v_user_one_id 
				   AND match_fixture_id = matchId;
				
				
				SELECT SUM(p.total_points) INTO v_total_points 
				  FROM player_individual_score_tbl p
				 WHERE p.player_id IN (SELECT u.player_selection_id# INTO v_total_points 
										 FROM ipl.user_player_selection_tbl u
										 WHERE user_selection_tbl_id = v_user_selection_tbl_id)
				   AND p.match_fixture_id = matchId;
				
                set v_user_win_team_player_points = 0;
                ## Added for Win Team Players Points                
                IF v_user_team_selection_id = v_team_winner_id  THEN
               # insert into test_tbl values (concat('id',v_user_one_id),v_user_team_selection_id,v_team_winner_id);
					select count(*) into v_team_player_count from player_tbl pt 
                     where pt.player_tbl_id IN (SELECT u.player_selection_id# INTO v_total_points 
												FROM ipl.user_player_selection_tbl u
											    WHERE user_selection_tbl_id = v_user_selection_tbl_id)
					   and pt.player_team_id = v_team_winner_id;
                       
					SET v_user_win_team_player_points = v_team_player_count * (SELECT points FROM ipl.points_detail_tbl WHERE points_category_code = 'teamPlayer');
                END IF;
				
				UPDATE ipl.user_fixtures_tbl
				SET user_one_total_points = v_total_points + 
									  (CASE WHEN v_user_team_selection_id = v_team_winner_id 
											THEN (SELECT points FROM ipl.points_detail_tbl WHERE points_category_code = 'teamwin')
											ELSE 0 
									   END) +
									  #(CASE WHEN v_user_mom_selection_id = v_match_player_mom_id 
											#THEN (SELECT total_points FROM ipl.player_individual_score_tbl WHERE player_id = v_match_player_mom_id and match_fixture_id = matchId) 
											#ELSE 0 
									   #END) #Removed for man of the match
									  (SELECT total_points FROM ipl.player_individual_score_tbl WHERE player_id = v_user_mom_selection_id and match_fixture_id = matchId) #added for power player
									+ v_user_win_team_player_points,
					user_one_team_player_points = v_user_win_team_player_points
				WHERE user_fixtures_tbl_id = v_user_fixtures_tbl_id;
				
				
			### For SECOND USER
				SELECT user_selection_tbl_id, user_team_selection_id, user_mom_selection_id 
				  INTO v_user_selection_tbl_id, v_user_team_selection_id, v_user_mom_selection_id
				  FROM ipl.user_selection_tbl 
				 WHERE user_id = v_user_two_id
				   AND match_fixture_id = matchId;
				
				
				SELECT SUM(p.total_points) INTO v_total_points 
				  FROM player_individual_score_tbl p
				 WHERE p.player_id IN (SELECT u.player_selection_id# INTO v_total_points 
										 FROM ipl.user_player_selection_tbl u
										 WHERE user_selection_tbl_id = v_user_selection_tbl_id)
				   AND p.match_fixture_id = matchId;
                   
				set v_user_win_team_player_points = 0;
				## Added for Win Team Players Points                
                IF v_user_team_selection_id = v_team_winner_id  THEN
					select count(*) into v_team_player_count from player_tbl pt 
                     where pt.player_tbl_id IN (SELECT u.player_selection_id# INTO v_total_points 
												FROM ipl.user_player_selection_tbl u
											    WHERE user_selection_tbl_id = v_user_selection_tbl_id)
					   and pt.player_team_id = v_team_winner_id;
                       
					SET v_user_win_team_player_points = v_team_player_count * (SELECT points FROM ipl.points_detail_tbl WHERE points_category_code = 'teamPlayer');
                END IF;
				 
				UPDATE ipl.user_fixtures_tbl
				   SET user_two_total_points = v_total_points + 
									  (CASE WHEN v_user_team_selection_id = v_team_winner_id 
											THEN (SELECT points FROM ipl.points_detail_tbl WHERE points_category_code = 'teamwin') 
											ELSE 0 
									   END) +
									  #(CASE WHEN v_user_mom_selection_id = v_match_player_mom_id 
											#THEN (SELECT total_points FROM ipl.player_individual_score_tbl WHERE player_id = v_match_player_mom_id  and match_fixture_id = matchId) 
											#ELSE 0 
									   #END) #Removed for man of the match
									   (SELECT total_points FROM ipl.player_individual_score_tbl WHERE player_id = v_user_mom_selection_id and match_fixture_id = matchId) #added for power player 
                                       + v_user_win_team_player_points,
						user_two_team_player_points = v_user_win_team_player_points
				 WHERE user_fixtures_tbl_id = v_user_fixtures_tbl_id;
    
                 UPDATE ipl.user_fixtures_tbl
                    set user_winner_id = (CASE WHEN user_one_total_points > user_two_total_points 
                                               THEN user_one_id 
                                               WHEN user_one_total_points < user_two_total_points
                                               THEN user_two_id 
                                          END)
                  WHERE user_fixtures_tbl_id = v_user_fixtures_tbl_id;
			  
              
select user_one_total_points, user_two_total_points into v_user_one_total_points, v_user_two_total_points from user_fixtures_tbl where match_id = matchId and user_fixtures_tbl_id=  v_user_fixtures_tbl_id;
set @v_user_total_points = v_user_one_total_points + v_user_two_total_points;

#insert into test_tbl values (concat('id ',@v_user_total_points),v_user_one_total_points,v_user_two_total_points);
			### UPDATING THE USER SELECTION TABLE WITH THE FINAL POINTS
				UPDATE ipl.user_selection_tbl
				   SET user_points = (CASE WHEN v_user_one_total_points > v_user_two_total_points
									  THEN @v_user_total_points
                                      WHEN v_user_one_total_points < v_user_two_total_points 
									  THEN @v_user_total_points * -1 
                                      WHEN v_user_one_total_points = v_user_two_total_points
									  THEN 0
								 END),              
                   # user_points = (select user_one_total_points - user_two_total_points from user_fixtures_tbl where match_id = matchId and user_fixtures_tbl_id=  v_user_fixtures_tbl_id),
					   result = (CASE WHEN user_points < 0 
									  THEN 'Lost' 
                                      WHEN user_points > 0
									  THEN 'Won'
                                      WHEN user_points = 0
									  THEN 'Draw'
								 END)
				WHERE match_fixture_id = matchId
				  AND user_id = v_user_one_id;
				  
				UPDATE ipl.user_selection_tbl
				   SET user_points = (CASE WHEN v_user_two_total_points > v_user_one_total_points
									  THEN @v_user_total_points
                                      WHEN v_user_two_total_points < v_user_one_total_points 
									  THEN @v_user_total_points * -1
                                      WHEN v_user_one_total_points = v_user_two_total_points
									  THEN 0
								 END),
                   
                   #user_points = (select user_two_total_points - user_one_total_points from user_fixtures_tbl where match_id = matchId and user_fixtures_tbl_id=  v_user_fixtures_tbl_id),
					   result = (CASE WHEN user_points < 0 
									  THEN 'Lost' 
                                      WHEN user_points > 0
									  THEN 'Won'
                                      WHEN user_points = 0
									  THEN 'Draw'
								 END)
				WHERE match_fixture_id = matchId
				  AND user_id = v_user_two_id;          
				  
		END LOOP;
		CLOSE user_fixtures_cur;    
		
        
        ##update match status to complete i.e 1
        
        UPDATE ipl.match_fixtures_tbl mft
           SET mft.match_status = 1
		 WHERE mft.match_fixtures_tbl_id = matchId;
         
		set outParam = 'success';
	ELSE
		SET outParam = 'noMatch';
        
	end if;
	commit;

	END ;;
DELIMITER ;
